import React from 'react'
import Button from './Button'
const Section = (sec) => {
    function portion()
    {
        switch(sec){
            case 1:
            {
              return(
                <section>
                    <div>
                    <Button ID={'Get Started'}/>
                    <Button ID={'Live Chat'}/>
                    </div>
                </section>
                )
            }
            default:
            {
                /*return (
                    <section>

                    </section>
                )*/
            }
        }
    }
  return (
    portion()
  )
}

export default Section
